import React, { useState, useEffect } from 'react'
import { NativeSelect, FormControl, Container } from '@material-ui/core';
import styles from './CountryPicker.module.css';
import { getCovidData } from '../../api';
import Accordion from '../Accordion/Accordion'
import Select from '../AutoComplete/AutoComplete'
import { TempleBuddhistOutlined } from '@mui/icons-material';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import { DataGrid } from '@mui/x-data-grid';
import Box from '@mui/material/Box';
import Chart from '../Chart/Chart'
import Cards from '../Cards/Cards'
import { Card, CardContent, Typography } from '@material-ui/core';
import Table from '@material-ui/core/Table';
import TableCell from '@material-ui/core/TableCell';
import TableRow from '@material-ui/core/TableRow';
import { makeStyles } from '@material-ui/core/styles';
import Loader from '../Loader/Loader';

const useStyles = makeStyles({
    table: {
        width: 650,
    },
});

const CountryPicker = ({ data }) => {
    const [stateMap, setStateMap] = useState({});
    const [isLoading, setIsLoading] = useState(true);
    const [global, setGlobal] = useState();
    const [states, setStates] = useState([]);
    const [selectedSno, setSelectedSno] = useState();
    const [selectedState, setSelectedState] = useState();
    const [confirmed, setConfirmed] = useState(0);
    const [recovered, setRecovered] = useState(0);
    const [death, setDeath] = useState(0);
    const classes = useStyles();

    console.log("AAAAAAA", data)


    useEffect(() => {
        const getStateData = async () => {
            let data;
            await getCovidData()
                .then(val => {
                    data = val;
                });
            let tempMap = {}
            let tempStates = []
            data.forEach(state => {
                if (!tempMap[state.sno]) {
                    tempMap[state.sno] = state
                    if (!state.state_name) {
                        state.state_name = "India"
                        setGlobal(state);
                    }
                    if (state.state_name)
                        tempStates.push({ label: state.state_name, sno: state.sno });
                }
            })
            setStateMap(tempMap);
            setStates(tempStates);
            setIsLoading(false);

        }
        getStateData();
    }, [])

    useEffect(() => {
        if (selectedSno) {
            setConfirmed(stateMap[selectedSno].new_positive)
            setRecovered(stateMap[selectedSno].new_cured)
            setDeath(stateMap[selectedSno].new_death)
            setSelectedState(stateMap[selectedSno].state_name)
        }
    }, [selectedSno])

    useEffect(() => {
        if (!isLoading && states["37"]) {
            setGlobal(states["37"])
        }
    }, [isLoading, states])


    const handleChange = (event, value) => {
        setSelectedSno(value.sno)
    }


    return (
        // isLoading ? <Loader open={isLoading} /> :
        <>
            {/* <Cards data={{ confirmed: confirmed, recovered: recovered, deaths: death }} /> */}
            {/* <Select data={states} onChange={handleChange} /> */}

            <Container>
                <Grid container spacing={2}>
                    <Grid item xs={6}>
                        <Chart data={{ confirmed: data?.new_positive, recovered: data?.new_cured, deaths: data?.new_death }} country={data?.state_name} />
                    </Grid>
                    <Grid item xs={6}>
                        <div className="App">
                            <div className='table-container'>
                                <Table className={classes.table} >
                                    <TableRow className='row-style'>
                                        <TableCell variant="head">Active Cases since yesterday</TableCell>
                                        <TableCell>{data?.new_positive - data?.positive}</TableCell>
                                    </TableRow>
                                    <TableRow className='row-style'>
                                        <TableCell variant="head">Cured since yesterday</TableCell>
                                        <TableCell>{data?.new_cured - data?.cured}</TableCell>
                                    </TableRow>
                                    <TableRow className='row-style'>
                                        <TableCell variant="head">Deaths since yesterday</TableCell>
                                        <TableCell>{data?.new_death - data?.death}</TableCell>
                                    </TableRow>
                                </Table>
                            </div>
                        </div>
                    </Grid>
                </Grid>
            </Container>


        </>

    )


}

export default CountryPicker;
